import './App.css';

import { useApi } from './hooks/use-api';



function MyButton(){
  return(
    <button>
      This is a button
    </button>
   );
  }


function App() {
  const { response } = useApi();

  return (
    <div className="App">
      <header className="App-header">
        <MyButton/>
        <p>
          {response}
        </p>
      </header>
    </div>
  );
}

export default App;
